class Status:
	def __init__(self, user, image, visibility='public', duration=24):
		self.user = user
		self.image = image
		self.visibility = visibility
		self.post_time = time.time()
		self.duration = duration
		self.expiry_time = self.post_time + (self.duration * 60 * 60)

	def change_visibility(self, visibility):
		self.visibility = visibility

	def is_expired(self):
		return time.time() > self.expiry_time


def remove_expired_statuses(status_db):
	for status_id in list(status_db.keys()):
		if status_db[status_id].is_expired():
			del status_db[status_id]"
    },
    {
      "file_path": "test_status.py",
      "file_contents": "import time
import unittest
from status import Status, remove_expired_statuses


class TestStatus(unittest.TestCase):
	def setUp(self):
		self.status_db = {}
		self.status_db['1'] = Status('user1', 'image1', duration=0.001)
		self.status_db['2'] = Status('user2', 'image2', duration=24)

	def test_change_visibility(self):
		self.status_db['1'].change_visibility('private')
		self.assertEqual(self.status_db['1'].visibility, 'private')

	def test_remove_expired_statuses(self):
		time.sleep(2)
		remove_expired_statuses(self.status_db)
		self.assertNotIn('1', self.status_db)
		self.assertIn('2', self.status_db)


if __name__ == '__main__':
	unittest.main()"
    }
  ]
}

